import React, { Component } from 'react';
import {Environment} from '../../src/components/environment';
import axios from 'axios';
import { If, Then, Else, Switch, Case} from 'react-if';

class Banner extends Component {

    constructor (props){
        super(props);

        this.state = {
            bannerList: [],
        //     quickLinks: [],
        //     gallery: [],
        //     weather: [],
        }

        axios.post(Environment.apiurl+'/getBannerList')
            .then(result => {
                if(result){
                    console.log(result);
                    this.setState({bannerList: result.data.response});
                }
            });
    }

    render(){
        return (
            <div>
                <section class="slider">
                    <div id="slide" class="owl-carousel owl-theme">

                    </div>
                </section>
            </div>
        )
    }
}

export default Banner;
